const RecipeList = (props) =>{
    console.log('props in Recipe list ->', props)

    const recipeList = props.recipes.map((recipe) =>{

        return (
            <div key={recipe.id}>

                <span>{recipe.title}</span>
                <img src={recipe.image}/>
                <span>{recipe.ingredients}</span>
            </div>
        )
    })
